shared.IS_ASPECT_RATIO_LOCKED = false;

shared.REFERENCE_RESOLUTION = new Vec2(2560, 1440);
shared.REFERENCE_RESOLUTION_HALF = new Vec2(1280, 720);

function updateResolutionData(resolution) {
	if (shared.IS_ASPECT_RATIO_LOCKED) {
		resolution.x = resolution.y * shared.ASPECT_RATIO;
	}

	shared.RESOLUTION = resolution;
	shared.RESOLUTION_HALF = new Vec2(resolution.x * 0.5, resolution.y * 0.5);

	shared.SCALE_FACTOR = new Vec2(
		shared.RESOLUTION.x / shared.REFERENCE_RESOLUTION.x,
		shared.RESOLUTION.y / shared.REFERENCE_RESOLUTION.y
	);
}

export function applyUserProperties(properties) {
	if (properties.hasOwnProperty('aspectratio')) {
		shared.IS_ASPECT_RATIO_LOCKED = Number(properties.aspectratio) != 0;
		shared.ASPECT_RATIO = Number(properties.aspectratio);

		updateResolutionData(engine.screenResolution);
	}
}

/**
 * @param {Vec3} value - screen resolution
 */
export function resizeScreen(value) {
	updateResolutionData(value);
}

/**
 * @param {Vec3} value - for property 'origin'
 * @return {Vec3} - update current property value
 */
export function init(value) {
	updateResolutionData(engine.screenResolution);
}

shared.clamp = (num, min, max) => {
	return Math.min(Math.max(num, min), max);
};

shared.reposition = (origin) => {
	return new Vec2(
		origin.x * shared.SCALE_FACTOR.x,
		origin.y * shared.SCALE_FACTOR.y
	);
}

shared.repositionTopLeft = () => {
	return new Vec2(
		-shared.RESOLUTION_HALF.x,
		shared.RESOLUTION_HALF.y
	);
}

shared.repositionCenterLeft = () => {
	return new Vec2(
		-shared.RESOLUTION_HALF.x,
		0
	);
}

shared.repositionBottomLeft = () => {
	return new Vec2(
		-shared.RESOLUTION_HALF.x,
		-shared.RESOLUTION_HALF.y
	);
}

shared.repositionTopCenter = () => {
	return new Vec2(
		0,
		shared.RESOLUTION_HALF.y
	);
}

shared.repositionCenter = () => {
	return new Vec2(
		0,
		0
	);
}

shared.repositionBottomCenter = () => {
	return new Vec2(
		0,
		-shared.RESOLUTION_HALF.y
	);
}

shared.repositionTopRight = () => {
	return new Vec2(
		shared.RESOLUTION_HALF.x,
		shared.RESOLUTION_HALF.y
	);
}

shared.repositionCenterRight = () => {
	return new Vec2(
		0,
		shared.RESOLUTION_HALF.y
	);
}

shared.repositionBottomRight = () => {
	return new Vec2(
		shared.RESOLUTION_HALF.x,
		-shared.RESOLUTION_HALF.y
	);
}

shared.rescaleX = (scale) => {
	return scale.x * shared.SCALE_FACTOR.x;
}

shared.rescaleY = (scale) => {
	return scale.y * shared.SCALE_FACTOR.y;
}

shared.rescaleMin = (scale) => {
	let factor = Math.min(shared.SCALE_FACTOR.x, shared.SCALE_FACTOR.y);
	return new Vec2(
		scale.x * factor,
		scale.y * factor
	);
}

shared.rescaleMax = (scale) => {
	let factor = Math.max(shared.SCALE_FACTOR.x, shared.SCALE_FACTOR.y);
	return new Vec2(
		scale.x * factor,
		scale.y * factor
	);
}

shared.rescaleBackground = (width, height) => {
	let factor = Math.max(
		engine.screenResolution.x / width,
		engine.screenResolution.y / height
	);

	return factor;
}

