		value: false
	})
	.addCheckbox({
		name: 'showMilliseconds',
		label: 'Show milliseconds',
		value: false
	})
	.addCheckbox({
		name: 'use24hFormat',
		label: 'ui_editor_properties_use_24h_format',
		value: true
	})
	.addCheckbox({
		name: 'ampm',
		label: 'Show AM/PM (in 12h format)',
		value: false
	})
	.addText({
		name: 'delimiter',
		label: 'Delimiter (anything between {})',
		value: '{:}'
	})
	.addText({
		name: 'whitespaces',
		label: 'Whitespaces (anything between {})',
		value: '{}'
	})
	.finish();

let delimiter, whitespaces;
export function update(value) {

	value = '';

	let time = new Date();
	let hours = time.getHours();
	let minutes
	let seconds;
	let milliseconds;
	let suffix = '';

	//Clock
	if (!scriptProperties.use24hFormat) {
		if (scriptProperties.ampm) suffix = hours >= 12 ? ' PM' : ' AM';
		hours %= 12;
		if (hours == 0) {
			hours = 12;
		}
	}

	hours = ("00" + hours).slice(-2);
	minutes = ("00" + time.getMinutes()).slice(-2);
	seconds = ("00" + time.getSeconds()).slice(-2);
	milliseconds = ("00" + time.getMilliseconds()).slice(-2);

	if (scriptProperties.showHours)
	{
		value = hours;
	}
	if (scriptProperties.showMinutes)
	{
		value += delimiter + minutes;
	}
	if (scriptProperties.showSeconds)
	{
		value += delimiter + seconds;
	}
	if (scriptProperties.showMilliseconds)
	{
		value += delimiter + milliseconds;
	}

	value += suffix;

	if (whitespaces != "")
	{
		let temp = "";
		for (let i = 0; i < value.length; i++)
		{
			temp += value[i] + whitespaces;
		}
		value = temp;
	}

	return value;
}

export function init() {
	delimiter = getDelimiter(scriptProperties.delimiter);
	whitespaces = getDelimiter(scriptProperties.whitespaces);
}

function getDelimiter(str)
{
	let delim;
	if (str != undefined && str.length >= 2)
	{
		delim = str.substring(
		str.indexOf("{") + 1, 
		str.lastIndexOf("}")
		);
	}
	else delim = "";
	return delim;
}

